import React, {Component} from "react";
class APIguts extends Component {
    constructor(props){
        super(props);
        this.state ={
            items:``,
            isLoaded:false,
        }
    }

componentDidMount(){
    fetch(`https://api.sampleapis.com/rickandmorty/characters`)
    .then(res => res.json())
    .then(data => {
        this.setState({
            items:data,
            isLoaded:true,
        })
    })
}

render(){
        if(this.state.isloaded === false) {
            return( <div className = "loading">Loading...</div>
            )
        }else return(
                <div className="apiguts">
                    passed!!!
                      <p>{this.state.items}</p>
                </div>
            )
        

        
    }
}

export default APIguts
